sources.scss/global/variables.scss:
//colors

$color-primary: white;
$color-secondary: #d9d9d9;
$color-third: #242424;
$color-fourth: #4ee1a0;
$color-fifth: #151515;

//fonts

$fontMain: "Space Grotesk";

@mixin headerMain() {
  font-family: $fontMain;
  font-style: normal;
  font-weight: 700;
  font-size: 8.8rem;
  line-height: 8.8rem;
  letter-spacing: -0.25rem;
  color: $color-primary;
}

@mixin headerSecondary() {
  font-family: $fontMain;
  font-style: normal;
  font-weight: 700;
  font-size: 4.8rem;
  line-height: 5.6rem;
  letter-spacing: -0.15rem;
  color: $color-primary;
}

@mixin primaryPar() {
  font-family: $fontMain;
  font-style: normal;
  font-weight: 500;
  font-size: 1.8rem;
  line-height: 2.8rem;
  color: $color-secondary;
}

@mixin secondaryPar() {
  font-family: $fontMain;
  font-style: normal;
  font-weight: 700;
  font-size: 1.6rem;
  line-height: 2.6rem;
  letter-spacing: 0.228571rem;
  text-transform: uppercase;
  border-bottom: solid 2px $color-fourth;
  padding-bottom: 0.5rem;
  width: 12rem;
  text-decoration: none;
  color: $color-primary;
}

